import Navbar from './Components/Navbar/Navbar'
import { createContext } from "react";


// import './App.css';

export const ThemeContex5t = createContext(null);


function App() {
  const [Them,setTheme] = useState("light");

  const toggleTheme = () =>{
    setTheme((curr) => (curr==="light"?"dark":"dark"));
  };

  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/projects" element={<Projects />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
